jQuery(document).ready(function ($) {


	//настройки маски 
	$(function ($) {
		$.mask.definitions['~'] = '[+-]';
		$('#inputTel').mask('+7(999)999-99-99');
	});


	// настройка маски с доработкой каретки
	$("#inputTel").click(function () {
		var zzz = this.value;
		if (zzz == "+7(___)___-__-__") {
			setTimeout(function () {
				document.getElementById("inputTel").selectionStart = 3;
				document.getElementById("inputTel").selectionEnd = 3;
			}, 1);
		}
	});


	// ввод телефона
	$("#inputTel").on("change blur submit keypress", function () {
		$("#textErrorTel").removeClass("error");
		$("#buttonForm").attr("disabled", false); // снимаем блокировку кнопке
	});



	/*форма заявки*/
	//E-mail Ajax Send
	$("#formQuiz").submit(function (e) {
		var th = $(this);
		e.preventDefault(); //отменяем событие по умолчанию (отправку формы)
		var telInput = $("#inputTel").val();
		$("#buttonForm").attr("disabled", true);
		//console.log(telInput + "значение телефона");	
		if (telInput == "") {
			console.log(" Не введен телефон ");
			$("#textErrorTel").addClass("error");
			return false;
		};


		$.ajax({
			type: "POST",
			url: "../php_qviz/send-telegram.php",
			data: th.serialize()
		}).done(function () {
			console.log("Спасибо, Ваша заявка принята!");
			//$("#modalThanks").removeСlass("closedModal");
			location.href = "../thanks_qviz.html"; // сразу переброс на нужную страницу
			// $("#buttonForm").attr("disabled", false);	 	
			setTimeout(function () {
				//	$("#buttonForm").attr("disabled", true);	 	
			}, 2000);
		});
		return false;
	});


});




